/// 阿里图标 svg
class AlIconSvg extends StatelessWidget {
  const AlIconSvg({
    super.key,
    required this.name,
    this.size = 18,
  });

  final String name;

  final double size;

  getSvg() {
    if (name == '') return '';
    return svgIcons.where((item) => item['name'] == name).single['show_svg'];
  }

  @override
  Widget build(BuildContext context) {
    String svgXml = getSvg();
    return SizedBox(
      width: size,
      height: size,
      child: svgXml == ''
          ? Icon(Icons.error, size: size)
          : SvgPicture.string(svgXml, width: size, height: size),
    );
  }
}

